=head1 ATTRIBUTES


=head2 AnalysisRule => L<Paws::AccessAnalyzer::AnalysisRule>




=head2 UnusedAccessAge => Int

The specified access age in days for which to generate findings for
unused access. For example, if you specify 90 days, the analyzer will
generate findings for IAM entities within the accounts of the selected
organization for any access that hasn't been used in 90 or more days
since the analyzer's last scan. You can choose a value between 1 and
365 days.



